const base641 = `data:image/png;base64,`
const base642 = `data:image/png;base64,`


const Repoter = require("./Repoter");

const repoter = new Repoter({tittleLevel:3})

// 
repoter.addTittle(1, "1")

repoter.addTittle(2, "2")

repoter.addTittle(3, "3")

repoter.addTittle(4, "4")

repoter.addParagraph("1   ")

repoter.addTittles(2, ["2","3"])

repoter.addParagraphs(["2   ", "3   "])

repoter.addPicWithDesc(base642, "1", [450,450])
repoter.addPicWithDesc(base641, "2", [450,450])

repoter.addTable(["1", "2","3"], [["1-1","1-2","1-3"],["2-1","2-2","2-3"],["3-1","3-2","3-3"]], desc="1")



// 


repoter.addTittle(1, "1-2")

repoter.addTittle(3, "3-2")

repoter.addTittle(2, "2-3")

repoter.addPicWithDesc(base642, "3", [450,450])
repoter.addPicWithDesc(base641, "4", [450,450])

repoter.addTable(["1", "2","3"], [["1-1","1-2","1-3"],["2-1","2-2","2-3"],["3-1","3-2","3-3"]], desc="2")

repoter.saveFile()